export default function KeyGenerator() {
    const generateRandomKey = (label) => {
        let generate = () => `${label}${(Math.round(Math.random()*100))}`;
        let key = generate();
        key = (this.keyArray.includes(key)) ? generate() : key;
        this.keyArray.push(key);
        return key
    }
}
